window.bookSummaryJSON = "<p>Renowned author Delphine Larue needs a haven. A crazed fan has gone over the deep end, and she’s not safe. Her security team has suggested a house by a lake. Secluded. Private. Far away. In a beautiful area of the Northwest close to the sleepy town of Misted Pines. It’s perfect. So perfect, Delphine has just moved in, and she’s thinking she’ll stay there forever.</p> <p>Until she sees the girl in the mist.</p> <p>After that, everything changes.</p> <p>Delphine quickly learns that Misted Pines isn’t so sleepy. A little girl has gone missing, and the town is in the grips of terror and tragedy. The local sheriff isn’t up for the job. The citizens are up in arms. And as the case unfolds, the seedy underbelly of a quiet community is exposed, layer by layer.</p> <p>But most importantly, girls are dying.</p> <p>There seems to be only one man they trust to find out what’s happening.</p> <p>The mysterious Cade Bohannan. </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
